comments.message:
Why the tabs?  Because I messed up.

Why clang-format off?  Because it makes the list read better, given that it's now

key value
key2 value2

and we can line it up for better reading.

If I were to do this again, I would've written readJson as something like

JsonReader jr = json_util::readJsonPatch(req, asyncResp->res);
jr.unpack("Oem/OpenBmc/Fan/PidControllers", pidControllers);
jr.unpack("Oem/OpenBmc/Fan/FanControllers", fanControllers);


just so we don't have to go through all this trickery.  oh well, problem for another day.
